INSERT INTO `creature_text` (`entry`, `groupid`, `id`, `text`, `type`, `language`, `probability`, `emote`, `duration`, `sound`, `BroadcastTextID`, `comment`) VALUES
(71865, x, x, 'Ha! Do you remember nothing of Honor? Of glory on the battlefield?  You who would parlay with the humans, who allowed warlocks to practice their dark magics right under our feet.  You are weak.', 14, 0, 100, 0, 0, 38059, 0, 'Garrosh Hellscream to Player'),
(71865, x, x, 'We are the Orcish Horde, the True Horde.  We die, bloody and thrashing on the field of battle, like true orcs SHOULD.', 14, 0, 100, 0, 0, 38060, 0, 'Garrosh Hellscream to Player'),
(71865, x, x, 'You are an Orc no longer, and speak for none but yourself. You betrayed our people to forge your fragile alliances, and I will take great pleasure in tearing them apart.', 14, 0, 100, 15, 0, 38061, 0, 'Garrosh Hellscream to Player'),
(71865, x, x, 'Fool. My Dark Shaman have twisted and tortured the elements for miles around. They cannot hear you now. Once again you prove too weak and powerless to do anything.', 14, 0, 100, 0, 0, 38062, 0, 'Garrosh Hellscream to Player'),
(71865, x, x, 'So, you wish to face off against a real Orc Warchief.  So be it.', 14, 0, 100, 0, 0, 38063, 0, 'Garrosh Hellscream to Player'),
(71865, x, x, 'I, Garrosh, son of Grom, will show you what it means to be called Hellscream!', 14, 0, 100, 0, 0, 38064, 0, 'Garrosh Hellscream to Player'),
(71865, x, x, '|TInterface\\Icons\\ability_mage_firestarter.blp:20|t|cFFFF0000Siege Engineers|r appear in the wings and begin to cast |cFFFF0000|Hspell:144616|h[Power Iron Star]|h|r!', 41, 0, 100, 0, 0, 0, 0, 'Garrosh Hellscream to Garrosh Hellscream'),
(71865, x, x, 'For the True Horde!', 14, 0, 100, 0, 0, 38073, 0, 'Garrosh Hellscream to 0'),
(71865, x, x, 'Farseers, mend our wounds!', 14, 0, 100, 0, 0, 38072, 0, 'Garrosh Hellscream to Garrosh Hellscream'),
(71865, x, x, 'Witness the power of the True Horde''s arsenal!', 14, 0, 100, 0, 0, 38068, 0, 'Garrosh Hellscream to Ko''kron Iron Star'),
(71865, x, x, 'Blood and Thunder!', 14, 0, 100, 0, 0, 38074, 0, 'Garrosh Hellscream to 0'),
(71865, x, x, '|TInterface\\Icons\\ability_mage_firestarter.blp:20|t|cFFFF0000Siege Engineers|r appear in the wings and begin to cast |cFFFF0000|Hspell:144616|h[Power Iron Star]|h|r!', 41, 0, 100, 0, 0, 38074, 0, 'Garrosh Hellscream to Garrosh Hellscream'),
(71865, x, x, 'We will cleanse this world in steel and fire!', 14, 0, 100, 0, 0, 38070, 0, 'Garrosh Hellscream to Ko''kron Iron Star'),
(71865, x, x, 'Pitiful.', 14, 0, 100, 0, 0, 38066, 0, 'Garrosh Hellscream to Player'),
(71865, x, x, 'Weak.', 14, 0, 100, 0, 0, 38065, 0, 'Garrosh Hellscream to Player'),
(71865, x, x, 'Now you know your place in my new world.', 14, 0, 100, 0, 0, 38067, 0, 'Garrosh Hellscream to 0'),
(71865, x, x, 'Die with honor!', 14, 0, 100, 0, 0, 38075, 0, 'Garrosh Hellscream to 0'),
(71865, x, x, '|TInterface\\Icons\\ability_mage_firestarter.blp:20|t|cFFFF0000Siege Engineers|r appear in the wings and begin to cast |cFFFF0000|Hspell:144616|h[Power Iron Star]|h|r!', 41, 0, 100, 0, 0, 38075, 0, 'Garrosh Hellscream to Garrosh Hellscream'),
(71865, x, x, '|TInterface\\Icons\\ability_mage_firestarter.blp:20|t|cFFFF0000Siege Engineers|r appear in the wings and begin to cast |cFFFF0000|Hspell:144616|h[Power Iron Star]|h|r!', 41, 0, 100, 0, 0, 38073, 0, 'Garrosh Hellscream to Garrosh Hellscream'),
(71865, x, x, 'Die with honor!', 14, 0, 100, 0, 0, 38068, 0, 'Garrosh Hellscream to 0'),
(71865, x, x, 'Anger. Hatred. Fear!! They are weapons of war - the tools of a Warchief!', 14, 0, 100, 5, 0, 38048, 0, 'Garrosh Hellscream to 0'),
(71865, x, x, 'Yes... yes I can see now...I can see the future of this world...a world ruled by the horde...MY horde.', 14, 0, 100, 5, 0, 38051, 0, 'Garrosh Hellscream to 0'),
(71865, x, x, 'You will be trapped for eternity!', 14, 0, 100, 0, 0, 38055, 0, 'Garrosh Hellscream to Garrosh Hellscream'),
(71865, x, x, '|TInterface\\Icons\\ability_garrosh_empowered_whirling_corruption.blp:20|t%s begins to cast |cFFFF0000|Hspell:144985|h[Empowered Whirling Corruption]|h|r!', 41, 0, 100, 0, 0, 38077, 0, 'Garrosh Hellscream to Garrosh Hellscream'),
(71865, x, x, 'The power to crush your world, and everything on it!', 14, 0, 100, 0, 0, 38077, 0, 'Garrosh Hellscream to Garrosh Hellscream'),
(71865, x, x, '|TInterface\\Icons\\ability_garrosh_whirling_corruption.blp:20|t%s begins to cast |cFFFF0000|Hspell:144985|h[Whirling Corruption]|h|r!', 41, 0, 100, 0, 0, 38076, 0, 'Garrosh Hellscream to Garrosh Hellscream'),
(71865, x, x, 'The power flows through me!', 14, 0, 100, 0, 0, 38076, 0, 'Garrosh Hellscream to Garrosh Hellscream'),
(71865, x, x, 'The Heart will be your end!', 14, 0, 100, 0, 0, 38053, 0, 'Garrosh Hellscream to Garrosh Hellscream'),
(71865, x, x, 'The True Horde WILL come to pass.  I have SEEN it.  IT HAS SHOWN ME. I HAVE SEEN MOUNTAINS OF SKULLS AND RIVERS OF BLOOD.  AND I WILL...HAVE...MY...WORLD!', 14, 0, 100, 5, 0, 38056, 0, 'Garrosh Hellscream to 0'),
(71865, x, x, 'No... It cannot end...like this...What I... What I have seen...', 14, 0, 100, 0, 0, 38046, 0, 'Garrosh Hellscream to Player'),
(72228, x, x, 'You will die when you leave this place.  There is nothing left of your world.', 15, 0, 100, 0, 0, 0, 0, 'Heart of Y''Shaarj to Player'),
(73483, x, x, 'It is not too late, Garrosh. Lay down the mantle of Warchief. We can end this here, now, with no more bloodshed.', 14, 0, 100, 0, 0, 38934, 0, 'Thrall to Player'),
(73483, x, x, 'Then you have forced my hand.  I will correct the mistake I made long ago.  Spirits of the wind, the earth, the water, hear my call!  Come to my aid!', 14, 0, 100, 0, 0, 38935, 0, 'Thrall to Player'),
(73483, x, x, 'Never powerless Garrosh. And never alone.', 14, 0, 100, 0, 0, 38936, 0, 'Thrall to Player');
